import { Button } from "@mui/material";
import { Route, Routes, useNavigate } from "react-router-dom";
import React, { useState } from "react";
import "./header.css";

function Header(props) {
  // console.log(props.userName.pathname);
  const navigate = useNavigate();
  const handleChange = () => {
    navigate('/login', { state: props.userName });
  };

  return (

    <div className="topnav">
      <div className="topnavLeft">
        {/* <img className="logoimg" src=".."></img> */}
        <h3 className='mo-login-logo'>
              TheMO
        </h3>
      </div>
      <div className="topnavRight" >
        <ul>
          {props.userName.pathname === "/login" ? <li><button>Let's Login</button></li> : <li><button onClick={handleChange} >Login</button></li>}

        </ul>

      </div>

    </div>
  );
}

export default Header;
